import Pokemon from "./Pokemon";
function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route> path='/' element={<Header />}</Route>
          <Route> path='/' element={<Pokemon />}</Route>
          <Route> path='/' element={<Pokemon />}</Route>
        </Routes>
      </BrowserRouter>
    </div>

  );
}

export default App;
